import ImageShow from "./ImageShow";
import ".com/ImageList.css"
const imageList = ({images}) => {
    const renderImages = images.map((item) => (
        <ImageShow image={item.urls.raw}/>
    ));

  return  <div>{renderImages}</div>
}

export default imageList;
